import exampleData from "../referenceCode/DBUPDATE";
import AppModel from "../JsModules/AppModel";
import Schedule from "../JsModules/Schedule";
import Course from "../JsModules/Course";
import { useState, useEffect } from "react";

function Scheduler() {
  const [app, updateApp] = useState(new AppModel());

  const functionalityTester = () => {
    // test adding to the existing schedule
    const schedID = app.schedules[0].id;

    // check ID exists
    // console.log(schedID);
    var course = new Course(
      "Math202",
      "MTH202",
      "01",
      "4.0",
      "M W F",
      "3:00PM",
      "Batelle 102",
      "Dr. Arrey"
    );
    // var schedule = new Schedule("Math Department");
    // schedule.addCourse(course);

    if (schedID) {
      // check that schedule can be grabbed
      var schedule = app.getScheduleById(schedID);

      // before add
      console.log("courses from before", schedule.courses.length);

      // log to check schedule grabbed
      console.log("grabbed by ID", schedule.name);

      // add the course to the schedule
      schedule.addCourse(course);

      // check that schedule has the new course, also reference the database to see if it is there
      console.log("Schedule should have added course", schedule.courses);
    }
  };

  return (
    <div className="scheduler">
      <table>
        <thead>
          <tr>
            <th>times</th>
            <th>Monday</th>
            <th>Tuesday</th>
            <th>Wednesday</th>
            <th>Thurday</th>
            <th>Friday</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>6AM</td>
          </tr>
          <tr>
            <td>7AM</td>
          </tr>
          <tr>
            <td>8AM</td>
          </tr>
          <tr>
            <td>9AM</td>
          </tr>
          <tr>
            <td>10AM</td>
          </tr>
          <tr>
            <td>11AM</td>
          </tr>
          <tr>
            <td>12PM</td>
          </tr>
          <tr>
            <td>1PM</td>
          </tr>
          <tr>
            <td>2PM</td>
          </tr>
          <tr>
            <td>3PM</td>
          </tr>
          <tr>
            <td>4PM</td>
          </tr>
          <tr>
            <td>5PM</td>
          </tr>
          <tr>
            <td>6PM</td>
          </tr>
        </tbody>
      </table>
      <button onClick={functionalityTester}>generate data</button>
    </div>
  );
}

export default Scheduler;
